 ● lietotņu datus;

 ● fotoattēlus, kuru sākotnējā versija netiek glabāta jūsu tālrunī (piemēram, ja ir ieslēgts iestatījums Optimize storage (Optimizēt krātuvi), sākotnējie fotoattēli tiek glabāti pakalpojumā iCloud®);

