 ● ierīces iestatījumus (piemēram, Wi-Fi tīklu paroles);

 ● mūziku ar digitālā satura tiesību pārvaldības (Digital Rights Management — DRM) aizsardzību (piemēram, iTunes® mūziku, kas iegādāta līdz 2009. gada aprīlim, vai mūziku, kas lejupielādēta, lai klausītos to bezsaistē mūzikas straumēšanas lietotnē);

 ● kontus, kuri nav Google konti (un ar tiem saistītos datus);

